import React from "react";
import {Route, Switch, HashRouter} from 'react-router-dom';
import Login from "../views/login";
import CadastroUsuario from "../views/cadastroUsuario";
import Home from "../views/home";
import Mensagem from "../views/mensagem";
import ConsultaLancamento from "../views/produtos/consulta-lancamento";
import CadastroProduto from "../views/produtos/cadastroProduto";

function Rotas(){
    return(
        <HashRouter>
            <Switch>
                <Route path="/login" component={Login}></Route>
                <Route path="/novo-usuario" component={CadastroUsuario}></Route>
                <Route path="/home" component={Home}></Route>
                <Route path="/mensagem" component={Mensagem}></Route>
                <Route path="/consulta-lancamentos" component={ConsultaLancamento}></Route>
                <Route path="/novo-produto/:id?" component={CadastroProduto}></Route>
            </Switch>
        </HashRouter>
    );
}
export default Rotas;
